// StillMe Desktop - Simple App Component for Testing
import React from 'react';

function App() {
  return (
    <div style={{ 
      padding: '20px', 
      fontFamily: 'Arial, sans-serif',
      backgroundColor: '#f0f0f0',
      minHeight: '100vh'
    }}>
      <h1>StillMe Desktop App</h1>
      <p>Desktop app đã khởi động thành công!</p>
      <p>Đang chờ kết nối với Gateway server...</p>
    </div>
  );
}

export default App;
